INSERT INTO ascendco.musc_orscansinout (            event_,            scan_day_name,            scan_date,            facility_name,            scanned_type,            scanned_desc,            location_desc,            scanned_dts,            scanned_by,            state_,            substate,            scanned_at,            scan_local,            hsys_name,            scan_dts,            timezone,            specialty,            clinic_dept_name,            item_type,            category,            item_name,            inv_name,            num_inst,            scan_hour_of_day,            scan_hour_bin,            scan_day_of_week,            inv_id,            facility_id,            hsys_id,            scanned_record_id,            item_id,            scan_id,            item_type_id,            speciality_id)      SELECT              expanded_data."Event",             expanded_data."Scan_DayName",             expanded_data."Scan_Date",             expanded_data."facilityName",             expanded_data."scannedType",             expanded_data."scannedDesc",             expanded_data."locationDesc",             expanded_data."scannedDTS",             expanded_data."scannedBy",             expanded_data."state",             expanded_data."substate",             expanded_data."scannedAt",             expanded_data."Scan_Local",             expanded_data."HsysName",             expanded_data."ScanDTS",             expanded_data."timezone",             expanded_data."Specialty",             expanded_data."ClinicDeptName",             expanded_data."ItemType",             expanded_data."Category",             expanded_data."ItemName",             expanded_data."InvName",             expanded_data."NumInst",             expanded_data."Scan_HourOfDay",             expanded_data."Scan_HourBin",             expanded_data."Scan_DayOfWeek",             expanded_data."InvID",             expanded_data."FacilityID",             expanded_data."HsysID",             expanded_data."scannedRecordID",             expanded_data."ItemID",             expanded_data."scanID",             expanded_data."ItemTypeID",             expanded_data."SpecialityID"        FROM domo_passthrough  CROSS JOIN jsonb_to_recordset(domo_passthrough.data) as expanded_data (             "Event" citext,             "Scan_DayName" citext,             "Scan_Date" citext,             "facilityName" citext,             "scannedType" citext,             "scannedDesc" citext,             "locationDesc" citext,             "scannedDTS" citext,             "scannedBy" citext,             "state" citext,             "substate" citext,             "scannedAt" citext,             "Scan_Local" citext,             "HsysName" citext,             "ScanDTS" citext,             "timezone" citext,             "Specialty" citext,             "ClinicDeptName" citext,             "ItemType" citext,             "Category" citext,             "ItemName" citext,             "InvName" citext,             "NumInst" float8,             "Scan_HourOfDay" float8,             "Scan_HourBin" float8,             "Scan_DayOfWeek" float8,             "InvID" uuid,             "FacilityID" uuid,             "HsysID" uuid,             "scannedRecordID" uuid,             "ItemID" uuid,             "scanID" uuid,             "ItemTypeID" uuid,             "SpecialityID" uuid)       WHERE dataset_name = 'MUSC_OrScansInOut_PG' AND             view_version = '1'